BEGIN TRANSACTION;
CREATE TABLE `periode` (
  `id_periode` int(11) NOT NULL,
  `libelle` varchar(255) NOT NULL,
  `dateDeb` date NOT NULL,
  `dateFin` date NOT NULL,
  `jourscirc` varchar(255) NOT NULL,
  `id_agglomeration` int(11) DEFAULT NULL,
  `type` int(11) DEFAULT NULL,
  PRIMARY KEY (`id_periode`)
);
CREATE TABLE `ligne` (
  `idLigne` int(11) NOT NULL,
  `libLigne` text NOT NULL,
  `colorLigne` text NOT NULL,
  `numLigne` varchar(11) DEFAULT NULL,
  `ordre_ligne` int(11) DEFAULT NULL,
  `kml` varchar(255) NOT NULL,
  `bis` int(11) NOT NULL,
  `id_agglomeration` int(11) DEFAULT NULL,
  `disable` int(11) NOT NULL,
  PRIMARY KEY (`idLigne`)
);
CREATE TABLE `join_utilisateur_agglomeration` (
  `idUtilisateur` int(11) NOT NULL,
  `id_agglomeration` int(11) NOT NULL,
  PRIMARY KEY (`idUtilisateur`,`id_agglomeration`)
);
CREATE TABLE `join_ligne_arret_horaire` (
  `id_jlah` int(11) NOT NULL,
  `idLigne` int(11) DEFAULT NULL,
  `idArret` int(11) DEFAULT NULL,
  `sens` text NOT NULL,
  `ordre_ligne` int(11) NOT NULL,
  `id_agglomeration` int(11) DEFAULT NULL,
  `favori` int(11) DEFAULT NULL,
  `latArret` double NOT NULL,
  `lngArret` double NOT NULL,
  PRIMARY KEY (`id_jlah`)
);
CREATE TABLE `join_horaire_periode_jlah` (
  `id_periode` int(11) DEFAULT NULL,
  `id_horaire` int(11) NOT NULL,
  `id_jlah` int(11) DEFAULT NULL,
  `ordre` int(11) NOT NULL,
  `id_agglomeration` int(11) DEFAULT NULL,
  `heure` text NOT NULL,
  `note` varchar(255) NOT NULL,
  PRIMARY KEY (`id_horaire`)
);
CREATE TABLE `arret` (
  `idArret` int(11) NOT NULL,
  `ID` text NOT NULL,
  `libArret` text NOT NULL,
  `latArret` double NOT NULL,
  `lngArret` double NOT NULL,
  `communeArret` text NOT NULL,
  `id_agglomeration` int(11) DEFAULT NULL,
  PRIMARY KEY (`idArret`)
);
CREATE TABLE `agglomeration` (
  `id_agglomeration` int(11) NOT NULL,
  `nom` varchar(255) NOT NULL,
  `lat_agglomeration` varchar(255) DEFAULT NULL,
  `lng_agglomeration` varchar(255) DEFAULT NULL,
  `nb_habitant_agglomeration` int(11) DEFAULT NULL,
  `code_postale_agglomeration` varchar(11) DEFAULT NULL,
  PRIMARY KEY (`id_agglomeration`)
);
COMMIT;
